import React, { useEffect, useRef } from "react";
import Flatpickr from "flatpickr";
import "flatpickr/dist/flatpickr.min.css";

const BirthdaatePicker = () => {
    const dateRef = useRef(null);

    useEffect(() => {
        Flatpickr(dateRef.current, {
            dateFormat: "Y-m-d",
            allowInput: true
        });
    }, []);

    return <input type="text" ref={dateRef} placeholder="DATE OF BIRTH" className="reqFormDate" />;
};

export default BirthdaatePicker;
